import "./R4c2Copy.css";

const R4c2Copy = ({ onClose }) => {
  return (
    <div className="r4c2-copy-div">
      <div className="r4c2-content-div">
        <span className="r4c2-content-txt-span">
          <p className="vehicletroller-1-p">Vehicle:troller 1</p>
          <p className="vehicletroller-1-p">Sáng: MCP 1</p>
          <p className="chiu-mcp-2">Chiều: MCP 2</p>
        </span>
      </div>
      <div className="r4c2-text-div">20</div>
    </div>
  );
};

export default R4c2Copy;
